import React, { Component } from "react";
import "./MyStyles.css";
class OpenSlam extends Component {
  constructor(props) {
    super(props);
    this.state = { slams: [], isloading: true };
  }
  async componentDidMount() {
    const slam = await (await fetch(
      `/apz/slam/${this.props.match.params.id}`
    )).json();
    this.setState({ slams: slam });
  }
  render() {
    const slam = this.state.slams;
    return (
      <div className="b">
        <p>{slam.name}</p>
        <p>{slam.address}</p>
        <p>{slam.phno}</p>
        <p>{slam.emailid}</p>
      </div>
    );
  }
}

export default OpenSlam;
